Chirixalus pantaiselatan

, 
new species
, differs from 

Chirixalus doriae

by having vomerine teeth (vs. absent: 
Boulenger, 1893
; 
Taylor, 1962
); presence of a white patch on side of upper jaw (vs. absent: 
Taylor, 1962
; 
Grismer et al., 2007a
); absence of dark postorbital stripe (vs. presence: 
Grismer et al., 2007a
); distinct glandular fold between eye and shoulder (vs. faint: 
Grismer et al., 2007a
); having tympanum diameter about two times that of Fin3DW (vs. equal to that of Fin3DW: 
Boulenger, 1893
; 
Taylor, 1962
; 
Grismer et al., 2007a
); presence of an external vocal sac (vs. absence: 
Grismer et al., 2007a
); third and fourth fingers one-fourth webbed (vs. webbed only at base: 
Taylor, 1962
; 
Grismer et al., 2007a
); tibiotarsal articulation reaching posterior of nostril (vs. reaching eye: 
Boulenger, 1893
; 
Taylor, 1962
); distinct transverse bands on forelimbs and hindlimbs (vs. indistinct to distinct spots: 
Boulenger, 1893
; 
Taylor, 1962
; 
Aowphol et al., 2013
); and more developed webbing on outer margin of third toe (vs. less developed: 
Taylor, 1962
: fig. 88, p. 538). 

Chirixalus pantaiselatan

, 
new species
, is distinguished from 

Chirixalus dudhwaensis

by the absence of a dark postorbital stripe (vs. presence: 
Ray, 1992
; 
Grismer et al., 2007a
); distinct transverse bands on the forelimbs and hindlimbs (vs. absence of markings: 
Ray, 1992
; 
Das et al., 2012
: fig. 4, p. 2557); third and fourth fingers onefourth webbed (vs. less webbed: 
Ray, 1992
); smooth dorsal skin (vs. skin with small tubercles; 
Ray, 1992
); a distinct glandular fold between eyes and shoulder (vs. faint: 
Ray, 1992
; 
Grismer et al., 2007a
). 

Chirixalus pantaiselatan

, 
new species
, is distinguished from 

Chirixalus simus

by having a larger body size, adult male SVL = 
25.3–28.9 mm
(vs. 
22 mm
: 
Annandale, 1915
; 20.0–24.0 mm: 
