Annandale, 1915
); presence of white patch on side of upper jaw (vs. absence; 
Annandale, 1915
; 
Grismer et al., 2007a
); smooth dorsal skin (vs. skin with small tubercles: 
Annandale, 1915
or smooth: 
Deuti, 2013
); third and fourth fingers onefourth webbed (vs. rudimentary webbing: 
Annandale, 1915
; 
Deuti, 2013
); distinct transverse bands on the forelimbs and hindlimbs (vs. absence of markings: 
Annandale, 1915
); and tibiotarsal articulation reaching posterior of the nostril (vs. tip of snout: 
Annandale, 1915
).

Chirixalus pantaiselatan

, 
new species
, is similar to 

Chirixalus nongkhorensis

in dorsal colour pattern, but has a slightly smaller body size, adult male SVL 
25.3–28.9 mm
(vs. 
28 mm
: 
Cochran, 1927
; 
29–32 mm
: 
Taylor, 1962
; 
25.6–31.1 mm
: 
Aowphol et al., 2013
); truncated snout (vs. pointed: 
Cochran, 1927
; 
Grismer et al., 2007a
); larger eye diameter, ED/SVL = 16.8 ± 1.09, 15.7–18.4% of SVL (vs. 12.2 ± 0.8, 10.6–14.3% of SVL: 
Aowphol et al., 2013
); smaller interorbital distance, IND/SVL 13.6 ± 1.38, 12.1–15.8% of SVL (vs. 19.7 ± 1.4, 11.3–22.1% of SVL: 
