Chirixalus pantaiselatan

, 
new species
, also differs from 

Chirixalus nongkhorensis

acoustically, with its advertisement call more variable in duration; means ± SD are 703.2 ± 402.75, 1,873.2 ± 570.53, and 4,431.2 ± 1,759.7 ms for short, medium, and long calls, respectively (vs. 497.8 ± 239.3 ms: 
Aowphol et al., 2013
) and have more notes per call, at 2–9, 11–17, and 22–46 notes per short, medium, and long call, respectively (vs. 2–4 notes: 
Aowphol et al., 2013
) and a slightly lower dominant frequency, ranging from 2.3–3.9 kHz (vs. 3.6–4.3 kHz: 
Aowphol et al., 2013
).
